INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (0.0, "2030/12/17 14:59:59", 2, 24, "2020/07/31 12:00:00", 2, "アヤネ", 401, 24001, 0.0, 102301, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (2.21, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 2, "アヤネ", 402, 24002, 0.0, 102301, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (0.0, "2030/12/17 14:59:59", 2, 24, "2020/07/31 12:00:00", 2, "アヤネ", 403, 24003, 0.0, 102301, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (1.99, "2030/12/17 14:59:59", 2, 24, "2020/07/31 12:00:00", 1, "アサヒ", 701, 24004, 0.0, 192201, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (2.21, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 2, "アサヒ", 702, 24005, 0.0, 192201, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (3.33, "2030/12/17 14:59:59", 2, 24, "2020/07/31 12:00:00", 1, "アサヒ", 703, 24006, 0.0, 192201, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (0.0, "2030/12/17 14:59:59", 2, 24, "2020/07/31 12:00:00", 2, "部員３", 801, 24007, 0.0, 192301, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (2.68, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 2, "部員３", 802, 24008, 0.0, 192301, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (0.0, "2030/12/17 14:59:59", 2, 24, "2020/07/31 12:00:00", 2, "部員３", 803, 24009, 0.0, 192301, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (0.0, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 1, "", 501, 24010, 0.0, 192501, "やった！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (0.0, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 1, "", 502, 24011, 0.0, 192501, "勝ったよ！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (0.0, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 1, "", 503, 24012, 0.0, 192501, "いい調子！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (5.33, "2030/12/17 14:59:59", 6, 24, "2020/07/31 12:00:00", 2, "ミサト", 111, 24013, 0.0, 113501, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (6.85, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 2, "ミサト", 112, 24014, 0.0, 113501, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (3.0, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 2, "ミサト", 113, 24015, 0.0, 113501, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (6.11, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 2, "ダイチ", 611, 24016, 0.0, 192401, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (6.75, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 2, "ダイチ", 612, 24017, 0.0, 192401, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (0.0, "2030/12/17 14:59:59", 2, 24, "2020/07/31 12:00:00", 2, "ダイチ", 613, 24018, 0.0, 192401, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (4.52, "2030/12/17 14:59:59", 2, 24, "2020/07/31 12:00:00", 1, "ハツネ", 211, 24019, 0.0, 113401, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (3.89, "2030/12/17 14:59:59", 2, 24, "2020/07/31 12:00:00", 1, "ハツネ", 212, 24020, 0.0, 113401, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (13.49, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 2, "ハツネ", 213, 24021, 0.0, 113401, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (3.17, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 2, "カヤ", 311, 24022, 0.0, 106501, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (4.42, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 2, "カヤ", 312, 24023, 0.0, 106501, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (2.89, "2030/12/17 14:59:59", 6, 24, "2020/07/31 12:00:00", 1, "カヤ", 313, 24024, 0.0, 106501, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (3.71, "2030/12/17 14:59:59", 4, 24, "2020/07/31 12:00:00", 3, "アヤネ", 421, 24025, 0.0, 102301, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (5.1, "2030/12/17 14:59:59", 2, 24, "2020/07/31 12:00:00", 1, "アサヒ", 721, 24026, 0.0, 192201, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (4.34, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 3, "部員３", 821, 24027, 0.0, 192301, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (0.0, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 1, "", 521, 24028, 0.0, 192501, "いい勝負だったよ\nまたやろうね", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (5.62, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 2, "ミサト", 101, 24029, -360.0, 113501, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (9.58, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 2, "ミサト", 102, 24030, -360.0, 113501, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (0.0, "2030/12/17 14:59:59", 2, 24, "2020/07/31 12:00:00", 2, "ミサト", 103, 24031, -360.0, 113501, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (9.13, "2030/12/17 14:59:59", 2, 24, "2020/07/31 12:00:00", 1, "ミサト", 104, 24032, -360.0, 113501, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 0.0, 10046);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (8.27, "2030/12/17 14:59:59", 1, 24, "2020/07/31 12:00:00", 2, "ミサト", 105, 24033, -360.0, 113501, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 0.0, 10046);
